'''
给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。


示例 1:

输入: s = "abcabcbb"
输出: 3 
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/longest-substring-without-repeating-characters
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
'''


def lengthOfLongsetSubstring(input_str):
    max_int = 0
    for i in range(len(input_str)):
        for j in range(len(input_str)):
            if sameCharator(input_str[i:j+1]):
                result_int = len(input_str[i:j+1])
                if result_int > max_int:
                    max_int = result_int
    return max_int

def sameCharator(item_str):
    for i in range(len(item_str)):
        if item_str.count(item_str[i]) > 1 and len(item_str) > 1:
            return False
    return True

def lengthOfLongsetSubstringEx(s):
    arr = []
    max_int = 0
    for i in range(len(s)):
        if arr.__contains__(s[i]):
            j = arr.index(s[i])
            arr = arr[j+1:]
            arr.append(s[i])
        else:
            arr.append(s[i])
        max_int = max(max_int, len(arr))
    return max_int


print(lengthOfLongsetSubstringEx("dvdf"))
print(lengthOfLongsetSubstringEx("bbbbb"))
print(lengthOfLongsetSubstringEx("pwwkew"))
